    # Tables of impulse and some related values for an explosion in an ideal
# homogeneous atmosphere.  The tables were created by integrating computed
# shock time histories and spatial profiles

    # The table variables are: 
    # [ X, Y, rpint_pos, rpint_neg, z_pos, z_neg, Qint_pos, rovp_min, z_ovp_min,
    #       ke_pos, work_pos, Disp_pos]
    # where
    #  X = ln(lambda) where lambda = scaled range of the shock front
    #  Y = ln(ovp ratio) 
    #  rpint_pos = r**(n/2) x scaled positive phase overpressure impulse, where n=0,1,2 is the symmetry
    #  rpint_neg = r**(n/2) x scaled negative phase overpressure impulse, where n=0,1,2 is the symmetry
    #  z_pos = z value at end of positive phase, where z=r-ct
    #  z_neg = z value at end of negative phase, if any
    #  Qint_pos = ln(dynamic pressure impulse = integral of rho*u**2)
    #  rovp_min = r**(n/2) * minimum overpressure ratio at this location
    #  z_ovp_min = z value at minimum overpressure ratio 
    #  ke_pos = kinetic energy in positive phase of the wave
    #  work_pos = work of positive phase of the wave
    #  Disp_pos = ln(peak displacement of a Lagrange point )


